import './App.css';
import Favourtite from './components/Favourtite';
import Meals from './components/Meals';
import Modal from './components/Modal';
import Search from './components/Search';

function App() {
  return (
    <div>
      <Search />
      <Favourtite />
      <Meals />
      <Modal />
    </div>
  );
}

export default App;
